import dashboard from '../../assets/dev_track_dashboard.png';
import contacts from '../../assets/dev_track_contacts.png';
import login from '../../assets/dev_track_login.png';
import application from '../../assets/dev_track_app.png';
import jeopardy_home from '../../assets/jeopardy_home.png';
import question from '../../assets/question.png';
import game_board from '../../assets/game_board.png';
import admin_cat from '../../assets/admin_cat.png';
import admin_questions from '../../assets/admin_questions.png';

export const dev_tracker_images = [
   {src: `${dashboard}`, alt: "dashboard"},
   {src: `${contacts}`, alt: "contacts"},
   {src: `${login}`, alt: "login"},
   {src: `${application}`, alt: "application"},
]

export const jeopardy_images = [
   {src: `${jeopardy_home}`, alt: "jeopard_home"},
   {src: `${game_board}`, alt: "game_board"},
   {src: `${question}`, alt: "question"},
   {src: `${admin_cat}`, alt: "admin_cat"},
   {src: `${admin_questions}`, alt: "admin_questions"},
]
